import React from "react";
import woman from "../../../assets/woman.png";
import "./Participant.css";
export default function Participant2({ stepsLeft }) {
  return (
    <div>
      <img src={woman} alt="Logo" />
      <div>Ansi Singh</div>
      <div>{stepsLeft}</div>
    </div>
  );
}
